webpackJsonp([0x382aa0acb989f000],{"./node_modules/json-loader/index.js!./.cache/json/entry-2015-05-11-create-hugo-theme.json":function(e,t){e.exports={data:{site:{siteMetadata:{title:":-)",author:"github.com/9renpoto"}},markdownRemark:{id:"/home/travis/build/9renpoto/entry/src/pages/2015-05-11-create-hugo-theme/index.md absPath of file >>> MarkdownRemark",html:'<h1>TL;DR</h1>\n<ul>\n<li>ブログを <code>octpress</code> から <code>hugo</code> へ移行しました</li>\n<li><a href="https://github.com/9renpoto/delic">hugo theme</a> 書きました</li>\n</ul>\n<h2>themeを書くために</h2>\n<p>cmd1つでテンプレート作成。</p>\n<div class="gatsby-highlight">\n      <pre class="language-sh"><code>$ hugo new theme foo\n.\n└── themes\n    └── foo\n    ├── LICENSE.md\n    ├── archetypes\n    │   └── default.md\n    ├── layouts\n    │   ├── _default\n    │   │   ├── list.html\n    │   │   └── single.html\n    │   ├── index.html\n    │   └── partials\n    │       ├── footer.html\n    │       └── header.html\n    ├── static\n    │   ├── css\n    │   └── js\n    └── theme.toml</code></pre>\n      </div>\n<p><a href="http://gohugo.io/templates/">Document</a> がよくまとまっていますので参考に。</p>\n<h2>TODO</h2>\n<ul>\n<li><code>layouts/_default</code> 以外の使い方調べる</li>\n<li>rss作成</li>\n<li>bower installするbuild script</li>\n</ul>\n<h2>感想</h2>\n<p>octpressの時はtheme流用してたので手作りも勉強になりました。</p>\n<p>t32kさんの<a href="https://github.com/t32k/mol">mol</a>を参考（ほぼコピー&#x26;ペーストして）に作りました\nありがとうございます。</p>',frontmatter:{title:"create hugo theme",date:"May 11, 2015"}}},pathContext:{path:"/entry/2015/05/11/create-hugo-theme/"}}}});
